import React from 'react';
import styles from './Footer.module.css';


const Footer = () => {
    return (
        <footer className={styles.footer}>
            <img src='/image/insta.jpg' />
            <h6>Rodiyah@2024</h6>
        </footer>
    );
};
export default Footer;
